import React from 'react';
import {
  BrowserRouter as Router,
  Routes,
  Route,
  Link
} from 'react-router-dom';
import Home from './Home';
import About from './About';
import Ads from './Ads';
import Register from './Register';
import Login from './Login';
import SearchAds from './SearchAds';
import './App.css';

function App() {
  return (
    <Router>
      <div>
        <nav>
          <ul>
            <li><Link to="/">Home</Link></li>
            <li><Link to="/about">About</Link></li>
            <li><Link to="/ads">Ads</Link></li>
            <li><Link to="/register">Register</Link></li>
            <li><Link to="/login">Login</Link></li>
          </ul>
        </nav>

        <Routes>
          <Route path="/" element={<Home />} />
          <Route path="/about" element={<About />} />
          <Route path="/ads" element={<Ads />}>
            <Route path="search" element={<SearchAds />} />  // Component for searching ads
            <Route path="seeking" element={<SeekingHome />} />  // Component for seeking a home
            <Route path="new" element={<CreateAd />} />  // Component for creating a new ad
          </Route>
          <Route path="/register" element={<Register />} />
          <Route path="/login" element={<Login />} />
        </Routes>
      </div>
    </Router>
  );
}

export default App;
